import React from "react";
import Card from "./card";
import contacts from "../contacts";
function createCard(){
  return(
    <Card name={contacts.name}/>
  )
}

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>

     {contacts.map(createCard)}


    </div>
  );
}

export default App;

